import Col from 'react-bootstrap/Col'


function SearchBar(){
    return(

        <Form>
        <Row>
          <Col>
            <Form.Control placeholder="Search" />
          </Col>
          <Col>
            <Form.Control placeholder="Last name" />
          </Col>
        </Row>
      </Form>


    )
}

export default SearchBar;
